```javascript
// function to check if all trips can be completed with given capacity
const f_gold = (trips, capacity) => {
    // create an array of 1001 elements, all initialized to 0
    let delta = new Array(1001).fill(0);
    // loop through each trip and update the delta array
    for (let [num, start, end] of trips) {
        delta[start] += num;
        delta[end] -= num;
    }
    // calculate the cumulative sum of delta array and check if all values are less than or equal to capacity
    return delta.map((sum => value => sum += value)(0)).every(x => x <= capacity);
}
```
